import React from 'react';
import {Autocomplete, TextField} from "@mui/material";
import {useQuery} from "react-query";
import {getUsers} from "../../ApiService/users.api";

const InputUsersFilter = (props: any) => {
    const [users, setUsers] = React.useState([] as any)
    // API get ALL Users
    useQuery({
        queryKey: ["getAllUsers"],
        queryFn: () => getUsers({params:{skip_page: 1}}),
        onSuccess: (data) => {
            setUsers(data.data);
        }
    })
    const handleOnChange = (event: any, values: any) => {
        props.onChange(values);
    }
    return (
        <Autocomplete
            multiple={props.multiple}
            id="combo-box-employee"
            size="small"
            options={users}
            getOptionLabel={(option) => option.name}
            onChange={handleOnChange}
            renderInput={(params) => <TextField {...params} label={props.title} />}
        />
    );
};

export default InputUsersFilter;
